import { HashRouter as Router, Route } from 'react-router-dom'
import './App.css';
import Header from './components/Header/Header'
import Banner from './components/Banner'
import Footer from './components/Footer/Footer'
function App() {
  return (
    <Router>
      <Header/>
      <Banner/>
      <Footer/>
    </Router>
  );
}

export default App;
